import React from "react";
import "./Navbar.css";

function Navbar() {
  return (
    <div className="navbar">
      <img
        src="https://5studios.net/themes/laapp/img/logo-light.png"
        alt=""
        className="navbar__logo"
      />
<div className="bar__container">
      <div className="bar"></div>

      <div className="bar"></div>

      <div className="bar"></div>
      </div>

      <ul className="navbar__items">
        <NavItem item="Home"/>
        <NavItem item="Features"/>
        <NavItem item="Product"/>
        <NavItem item="Pricing"/>
        <NavItem item="Trial"/>
      </ul>
    </div>
  );
}

const NavItem = ({ item }) => {
  return (
    <li>
      <a href={`#${item}`} className="navbar__item">
        {item}
      </a>
    </li>
  );
};

export default Navbar;
